//-------------------------------simple netflix challenge
ReactDOM.render(
    <>
        <h1>Thapa Technical netflix Pick</h1>
        <h2>List of 5 best Series</h2>
        <ol>
        <li>Dark</li>
        <li>blue</li>
        <li>light</li>
        <li>abs</li>
        <li>efwhwek</li>
        </ol>
    </>,
    document.getElementById("root"));
